import React from 'react';
import PropTypes from 'prop-types';

import { Panel, PanelHeader, PanelHeaderBack } from '@vkontakte/vkui';

const Menu = (
    <Panel id={props.id}>
        <PanelHeader>
            Твой билет
        </PanelHeader>
    </Panel>
)
Persik.propTypes = {
    id: PropTypes.string.isRequired,
    go: PropTypes.func.isRequired,
};
export default Menu;
